	<!--<div class="wrap">
		<p>
			Фонд «Росконгресс» — крупнейший организатор конгрессно-выставочных мероприятий.
		</p>

		<p>
			Фонд «Росконгресс» учрежден в 2007 году с целью содействия развитию экономического потенциала и укрепления имиджа России посредством организации и проведения конгрессных, выставочных и общественных мероприятий. Фонд формирует их содержательную часть, оказывает консалтинговую, информационную и экспертную поддержку компаниям и организациям, а также всесторонне изучает, анализирует и освещает вопросы российской и глобальной экономической повестки. Фонд обеспечивает администрирование и содействует продвижению бизнес-проектов и привлечению инвестиций, в том числе в рамках государственно-частного партнерства.
		</p>

		<p>
			Сегодня годовая программа Фонда включает мероприятия от Монтевидео до Владивостока, что позволяет собирать на одной площадке лидеров мирового бизнеса, экспертов, СМИ, представителей власти, создавать лучшие условия для обсуждения и продвижения новых идей и проектов, а также оказывать содействие в формировании социального предпринимательства и благотворительных проектов.
		</p>

		<p>
			<a href="//www.roscongress.org" target="_blank">www.roscongress.org</a>
		</p>

		<p>
			Национальный Центр ГЧП – ведущий институт развития в сфере ГЧП в России
		</p>

		<p>
			Национальный Центр ГЧП создан в 2009 с целью содействия привлечению частных инвестиций, эффективных управленческих решений и современных технологий в проекты по развитию общественной инфраструктуры с применением механизмов государственно-частного партнерства. Национальный Центр ГЧП признан Всемирным банком как официальный институт развития ГЧП в России и выступает оператором Рейтинга субъектов Российской Федерации по уровню развития ГЧП.
		</p>

		<p>
			В рамках образовательных программы, инициированных Центром, обучено более 4000 специалистов органов государственной власти, в 49 субъектах Российской Федерации внедряется ГЧП-стандарт, разработанный Центром. Эксперты Национального Центра ГЧП оказали содействие в подготовке более 80 региональных и муниципальных проектов ГЧП.
		</p>

		<p>
			В настоящее время приоритетными проектами Национального Центра ГЧП определены реализация Программы поддержки проектных инициатив в регионах и развитие цифровой платформы «РОСИНФРА» (<a href="//www.pppi.ru" target="_blank">www.pppi.ru</a>).
		</p>

		<p>
			<a href="//www.pppcenter.ru" target="_blank">www.pppcenter.ru</a>
		</p>
	</div>-->
</div>





